import Home from "./components/Home.vue";
import Login from "./components/Login.vue";
import Ordine from "./components/Ordine.vue";
import Accetta from "./components/Accetta.vue";
import { createRouter, createWebHistory } from 'vue-router'
const routes = [
    {
        path: '/',
        redirect: '/login'  // Reindirizza alla pagina Login
      },
    {
        name: "Login",
        component: Login,
        path: "/login",
    },
    {
        name: "Home",
        component: Home,
        path: "/",
    },
    {
        name: "Ordine",
        component: Ordine,
        path: "/ordine",
    },
    {
        name: "Accetta",
        component: Accetta,
        path: "/accetta",
    }

];

const router = createRouter({
    history: createWebHistory(),
    routes
});

export default router;
